import { useEffect } from "react";
import { useParams } from "react-router-dom";

export default function Edit() {
  let params = useParams();
  //   useEffect(() => {
  //     fetch(`http://localhost:8000/Prodact/${params.id}`)
  //       .then((res) => res.json())
  //       .then((data) => console.log(data));
  // })
  return (
    <div>
      <form>
        <div className="mb-3 ">
          <h2 htmlFor="title" className="form-label">
            Add Prodat
          </h2>
          <input
            type="text"
            className="form-control"
            id="title"
            placeholder="title"
          />
        </div>
        <div className="mb-3">
          <label htmlFor="prodact price" className="form-label">
            price
          </label>
          <input
            type="text"
            className="form-control"
            id="prodact price"
            placeholder="Price"
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Add Prodact
        </button>
      </form>
    </div>
  );
}
